import React from 'react';
import ReactDOM from 'react-dom';
import ForgeViewer from './js/ForgeViewer';
import 'font-awesome/css/font-awesome.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';
import './index.css';
// import App from './App';
import { MDBBtn, MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, Table, TableBody, TableHead } from 'mdbreact';
import registerServiceWorker from './registerServiceWorker';

ReactDOM.render(
  <div>
      <div class="row">
      <Table hover id="csvDataTable" border="2" color="primary-color" textWhite>

      </Table>
    </div>
    <div class="row center" id="forgeViewer"></div>

    <div class="row">
      <div id="openViewerBtn" class="btn">BUTTON</div>
      <div id="exportStepBtn" class="btn">BUTTON STEP</div>
    </div>

    <div class="row">
      <MDBBtn color="primary">TEST</MDBBtn>
    </div>

  </div>,
  document.getElementById('root')
);
registerServiceWorker();
ForgeViewer.launchViewer();


